import React from "react";

const CartOrderForm = () => {
  return (
    <form>
      <div>
        <label htmlFor={props.input.id}>Adress:</label>
        <input />
      </div>
      <label htmlFor={props.input.id}>Name:</label>
      <input />
    </form>
  );
};

export default CartOrderForm;
